import React from 'react';
import '../../../styles/Header.css';

export default () => {
    return (
        <>
        <div className="container-fluid">
           <div className="header">
            <nav className="navbar navbar-expand-lg head_brand">
                <a className="navbar-brand font-italic" href="google.com">Ad setting demo</a>
                <a clasaName="navbar-text my-2 my-lg-0 username" href="https://www.facebook.com/">Username</a>
                <form className="form-inline my-2 my-lg-0">
      <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search"></input>
      <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
    </form>
            </nav>
           </div>
        </div>
        </>
    )
}
